`,s.jsx(e.h2,{children:"I know what you're thinking..."}),`
`,s.jsxs(e.ul,{children:[`
`,s.jsx(e.li,{children:"What does the World need with another React form library?"}),`
`,s.jsx(e.li,{children:"What makes this different, better, and/or worse than all the other form libraries?"}),`
`,s.jsx(e.li,{children:"Will this guy do my homework for me?"}),`
`,s.jsx(e.li,{children:"Why do we exist?"}),`
`,s.jsx(e.li,{children:"What is the meaning of life?"}),`
`,s.jsx(e.li,{children:"Where did I leave my car keys?"}),`
